import React, {useState, useEffect} from 'react'
import {withRouter, NavLink, Link } from 'react-router-dom'
import './footer.css'
const Footer = () => {
return (
    <nav
      id='navBar'
      className='navbar navbar-expand-lg navbar-light bg-light'
    >
        <h1 id='topMenuLeft'>
          Elin Forsberg
        </h1>
      </nav>
      
)}

export default withRouter(Footer)
